import Post from '../Post/Post'
import posts from '../../data/posts'

const Posts = () => {
  return (
    <div className="posts">
      {posts.map((post) => (
        <Post key={post.id} {...post} />
      )
        
      )}
    </div>
  )
}

export default Posts
